const FeatureList = () => {
  return (
    <div className='flex max-w-2xl shadow border-2 mx-auto py-4 my-4'>
        <button className='text-white bg-green-600 hover:bg-green-800 rounded px-4 py-2 mx-auto'>Employee List</button>
        <button className='text-white bg-green-600 hover:bg-green-800 rounded px-4 py-2 mx-auto'>Add Employee</button>
    </div>
  );
}

export default FeatureList;
